INSERT INTO `cms_article` VALUES ('20', 'blue', '<pre class=\"brush:java;toolbar:false;\">package&nbsp;org.guess.security.controller;\r\n\r\nimport&nbsp;javax.servlet.http.HttpServletRequest;\r\nimport&nbsp;javax.servlet.http.HttpSession;\r\n\r\nimport&nbsp;org.apache.shiro.SecurityUtils;\r\nimport&nbsp;org.apache.shiro.authc.AuthenticationException;\r\nimport&nbsp;org.apache.shiro.authc.ExcessiveAttemptsException;\r\nimport&nbsp;org.apache.shiro.authc.IncorrectCredentialsException;\r\nimport&nbsp;org.apache.shiro.authc.LockedAccountException;\r\nimport&nbsp;org.apache.shiro.authc.UnknownAccountException;\r\nimport&nbsp;org.apache.shiro.authc.UsernamePasswordToken;\r\nimport&nbsp;org.apache.shiro.subject.Subject;\r\nimport&nbsp;org.guess.core.Constants;\r\nimport&nbsp;org.guess.core.utils.security.Coder;\r\nimport&nbsp;org.guess.sys.model.Log;\r\nimport&nbsp;org.guess.sys.model.User;\r\nimport&nbsp;org.guess.sys.service.LogService;\r\nimport&nbsp;org.guess.sys.service.UserService;\r\nimport&nbsp;org.springframework.beans.factory.annotation.Autowired;\r\nimport&nbsp;org.springframework.stereotype.Controller;\r\nimport&nbsp;org.springframework.web.bind.annotation.RequestMapping;\r\nimport&nbsp;org.springframework.web.bind.annotation.RequestMethod;\r\nimport&nbsp;org.springframework.web.bind.annotation.RequestParam;\r\nimport&nbsp;org.springframework.web.servlet.view.InternalResourceViewResolver;\r\n\r\n@Controller\r\n@RequestMapping(&quot;/&quot;)\r\npublic&nbsp;class&nbsp;LoginController&nbsp;{\r\n	\r\n	@Autowired\r\n	private&nbsp;HttpSession&nbsp;session;\r\n	\r\n	@Autowired\r\n	private&nbsp;LogService&nbsp;logService;\r\n	\r\n	@Autowired\r\n	private&nbsp;UserService&nbsp;userService;\r\n	\r\n	@RequestMapping(method&nbsp;=&nbsp;RequestMethod.GET)\r\n	public&nbsp;String&nbsp;index()&nbsp;{\r\n		System.out.println(&quot;index&quot;);\r\n		return&nbsp;&quot;login&quot;;\r\n	}\r\n\r\n	@RequestMapping(method&nbsp;=&nbsp;RequestMethod.GET,value=&quot;/login&quot;)\r\n	public&nbsp;String&nbsp;login()&nbsp;{\r\n		/*Object&nbsp;object&nbsp;=&nbsp;session.getAttribute(Constants.CURRENT_USER);\r\n		System.out.println(object);*/\r\n		return&nbsp;&quot;login&quot;;\r\n	}\r\n\r\n	@RequestMapping(method&nbsp;=&nbsp;RequestMethod.POST,value=&quot;login&quot;)\r\n	public&nbsp;String&nbsp;login(@RequestParam(&quot;userName&quot;)&nbsp;String&nbsp;userName,&nbsp;@RequestParam(&quot;password&quot;)&nbsp;String&nbsp;password,\r\n			@RequestParam(value=&quot;rememberMe&quot;,required=false,defaultValue=&quot;false&quot;)&nbsp;boolean&nbsp;remember,HttpServletRequest&nbsp;request)&nbsp;{\r\n\r\n		UsernamePasswordToken&nbsp;token&nbsp;=&nbsp;new&nbsp;UsernamePasswordToken(userName,&nbsp;Coder.encryptMD5(userName+password));\r\n		token.setRememberMe(remember);\r\n		Subject&nbsp;currentUser&nbsp;=&nbsp;SecurityUtils.getSubject();\r\n		try&nbsp;{\r\n			currentUser.login(token);\r\n		}&nbsp;catch&nbsp;(UnknownAccountException&nbsp;uae)&nbsp;{\r\n			System.out.println(&quot;[&quot;&nbsp;+&nbsp;userName&nbsp;+&nbsp;&quot;]..,&quot;);\r\n			request.setAttribute(&quot;message_login&quot;,&nbsp;&quot;&quot;);\r\n		}&nbsp;catch&nbsp;(IncorrectCredentialsException&nbsp;ice)&nbsp;{\r\n			System.out.println(&quot;[&quot;&nbsp;+&nbsp;userName&nbsp;+&nbsp;&quot;]..,&quot;);\r\n			request.setAttribute(&quot;message_login&quot;,&nbsp;&quot;&quot;);\r\n		}&nbsp;catch&nbsp;(LockedAccountException&nbsp;lae)&nbsp;{\r\n			System.out.println(&quot;[&quot;&nbsp;+&nbsp;userName&nbsp;+&nbsp;&quot;]..,&quot;);\r\n			request.setAttribute(&quot;message_login&quot;,&nbsp;&quot;&quot;);\r\n		}&nbsp;catch&nbsp;(ExcessiveAttemptsException&nbsp;eae)&nbsp;{\r\n			System.out.println(&quot;[&quot;&nbsp;+&nbsp;userName&nbsp;+&nbsp;&quot;]..,&quot;);\r\n			request.setAttribute(&quot;message_login&quot;,&nbsp;&quot;&quot;);\r\n		}&nbsp;catch&nbsp;(AuthenticationException&nbsp;ae)&nbsp;{\r\n			//&nbsp;ShiroAuthenticationException\r\n			System.out.println(&quot;[&quot;&nbsp;+&nbsp;userName&nbsp;+&nbsp;&quot;]..,&quot;);\r\n			ae.printStackTrace();\r\n			request.setAttribute(&quot;message_login&quot;,&nbsp;&quot;&quot;);\r\n		}\r\n		//&nbsp;\r\n		if&nbsp;(currentUser.isAuthenticated())&nbsp;{\r\n			try&nbsp;{\r\n				User&nbsp;curUser&nbsp;=&nbsp;userService.findByLoginId(userName);\r\n				logService.save(new&nbsp;Log(&quot;&quot;,&nbsp;1,&nbsp;&quot;&quot;,&nbsp;curUser,request.getRemoteAddr()));\r\n			}&nbsp;catch&nbsp;(Exception&nbsp;e)&nbsp;{\r\n				e.printStackTrace();\r\n			}\r\n			return&nbsp;&quot;redirect:/sys/user/list&quot;;\r\n		}&nbsp;else&nbsp;{\r\n			token.clear();\r\n		}\r\n		return&nbsp;&quot;/login&quot;;\r\n	}\r\n	\r\n	/**\r\n	&nbsp;*&nbsp;\r\n	&nbsp;*/\r\n	@RequestMapping(&quot;/logout&quot;)\r\n	public&nbsp;String&nbsp;logout(HttpServletRequest&nbsp;request)&nbsp;{\r\n		User&nbsp;curUser&nbsp;=&nbsp;(User)&nbsp;session.getAttribute(Constants.CURRENT_USER);\r\n		SecurityUtils.getSubject().logout();\r\n		try&nbsp;{\r\n			logService.save(new&nbsp;Log(&quot;&quot;,&nbsp;1,&nbsp;&quot;&quot;,&nbsp;curUser,request.getRemoteAddr()));\r\n		}&nbsp;catch&nbsp;(Exception&nbsp;e)&nbsp;{\r\n			e.printStackTrace();\r\n		}\r\n		return&nbsp;InternalResourceViewResolver.REDIRECT_URL_PREFIX&nbsp;+&nbsp;&quot;/login&quot;;\r\n	}\r\n}</pre><p><br/></p>', '2014-05-01', '', null, null, '1', '', 't4-', null, null, '7');
